sequence = ' '


def is_start(*args):
    return len(set([*args])) == 4


def is_start_14(*args, **kwargs):
    return len(set([*args])) == 14


lns = []
i = 4
while i < len(sequence) - 4:
    if is_start(*sequence[i-4:i]):
        lns.append(i - (lns[-1] if len(lns) else 0))
    i += 1
print(lns[0])

lns = []
i = 14
while i < len(sequence) - 14:
    if is_start_14(*sequence[i-14:i]):
        lns.append(i - (lns[-1] if len(lns) else 0))
    i += 1
print(lns[0])

